import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link, useLocation } from 'react-router-dom';
import './App.css';
import Header from './Header';
import Home from './Home';
import Store from './Store';
import Info from './Info';
import Product, { myInitObject } from './Products/Product.js'

function App() {
  //let location = useLocation();
  return (
    <Router>
      <div className="app">
          <Switch>
            <Route exact path='/product'>
              <Header/>
              <Product 
              // id={this.props.location.state.id}
              // image={this.props.location.state.image}
              title={myInitObject.id}
              // price={this.props.location.state.price}
              />
            </Route>
            <Route path='/store/frames'>
              <Header/>
              <Store items='Frames'/>
              <Info />
            </Route>
            <Route path='/store/hiveComponents'>
              <Header/>
              <Store items='HiveComponents'/>
              <Info />
            </Route>
            <Route path='/store/beeHiveKits'>
              <Header/>
              <Store items='BeeHiveKits'/>
              <Info />
            </Route>
            <Route path='/store/bargainBarnItems'>
              <Header/>
              <Store items='BargainBarnItems'/>
              <Info />
            </Route>
            <Route path='/store/nucBoxesSupplies'>
              <Header/>
              <Store items='NucBoxesSupplies'/>
              <Info />
            </Route>
            <Route path='/'>
              <Header />
              <Home />
              <Info />
            </Route>

          </Switch>
      </div>
    </Router>
  );
}

export default App;
